import React, {Component, Fragment} from 'react';
import Home from "./components/home.component"
import Login from "./components/login.component"
import ManageAccounts from "./components/manage-accounts.component"
import './App.css';
import {BrowserRouter, Link, Route} from "react-router-dom"

class App extends Component {
    render() {
        return (
            <BrowserRouter>
                <Fragment>
                    <div className="scrolling-wrapper">
                        <div className="carda"><h2>Home</h2></div>
                        <div className="carda"><Link to="/manage-accounts"><h2>Manage Accounts</h2></Link></div>
                        <div className="carda"><h2>Manage beneficiaries</h2></div>
                        <div className="carda"><h2>Make Payments</h2></div>
                        <div className="carda"><h2>Transfer</h2></div>
                        <div className="carda"><h2>Buy</h2></div>
                    </div>
                    <Route exact path="/" component={Login}/>
                    <Route exact path="/home" component={Home}/>
                    <Route exact path="/manage-accounts" component={ManageAccounts}/>
                </Fragment>
            </BrowserRouter>
        );
    }
}

export default App;
